NISSAN ニッサン セレナ C26系ガングリップステアリングＡＬＬパンチングレザー【赤ステッチ】 




■ALLパンチングレザータイプステアリングの交換だけでスポーティー＆スタイリッシュなコックピットに！■パンチングレザーガングリップあふれるスポーツテイストと手にしっくりとなじむ絶妙のグリップ感が、コクピットを一段と精悍に演出させたモデル。まるで別の車かのようにハンドル操作性が変わります。柔らかな風合いとソフトな手触りが特長です。■コブ付高級車では当たり前のコブ付仕様しっかり手になじみ、確実なハンドリングを容易にします 純正ステアリングを車輌本体からはずし、エアバック、スイッチ、カバー類を入れ換え再度車輌本体に装着していただければ完成です。■エアバック今お車に付いている、純正エアバックが使用できます。 






仕様
【適合】NISSAN セレナ C26系専用設計レザー部仕様パンチングレザータイプ(ブラック)ステアリング形状ガングリップタイプステッチ：レッド 

ご注意
純正加工品ではありません。新品ステアリングです。純正エアバック、ホーンパッドを使用するためエアバックもそのまま使えて安心です。注意：ステアリングはご自身で取り付けず専門店で取り付けて下さい。※ステアリング以外のエアバック等パーツは再使用しますのでなくさないようにご注意ください。※商品にエアバック・スイッチ類は付属されていません。純正ステアリングを車輌本体からはずし、エアバック、スイッチ、カバー類を入れ換え再度車輌本体に装着していただければ完成です。※ステアリング以外のエアバック等パーツは再使用しますのでなくさないようにご注意ください。※商品にエアバック・スイッチ類は付属されていません。社外品となるため、1コマ以内のセンターズレが起こる場合がございますが、商品不良ではございません。センターズレが気になる場合は整備業者で調整(タイロッド調整)をご依頼下さい。※整備費用はご自信でご負担下さい。※輸送時の破損以外はノークレームでお願いします。 







　■セレナC26がバージョンＵＰ！



